import React from 'react';
import City from './City.js';
import data from '../assets/json/data.js';

class SecondContent extends React.Component {
    createTable() {
        let table = [];
        for (let i = 0; i < data.length; i++) {
            if(i <= 3) {
                const rand = Math.round(Math.random() * data.length) -1;
                console.log(rand);
                table.push(
                    <li key={i}>
                        <City src={data[rand].image} name={data[i].name} />
                    </li>
                );
            } else {
                break;
            }
        }
        return table;
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
            </div>
        );
    }
}

export default SecondContent;
